// src/pages/Register.js (FULL CODE - Refactored with FormInput)

import React, { useState } from "react";
import { registerDonor } from "../services/donorService";
import FormInput from "../components/FormInput"; // <-- NEW IMPORT

// --- Theme and Styles (Simplified container styles) ---
const styles = {
  container: {
    maxWidth: "500px",
    margin: "40px auto",
    padding: "30px",
    backgroundColor: "#f7f9fc",
    borderRadius: "12px",
    boxShadow: "0 4px 15px rgba(0, 0, 0, 0.1)",
    fontFamily: "'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif",
  },
  heading: {
    textAlign: "center",
    color: "#00796b",
    marginBottom: "20px",
    borderBottom: "2px solid #e0e0e0",
    paddingBottom: "10px",
  },
  form: {
    display: "flex",
    flexDirection: "column",
    gap: "15px",
  },
  button: {
    padding: "12px 20px",
    backgroundColor: "#d32f2f",
    color: "white",
    border: "none",
    borderRadius: "6px",
    cursor: "pointer",
    fontSize: "16px",
    fontWeight: "bold",
    transition: "background-color 0.3s",
    textTransform: "uppercase",
    letterSpacing: "1px",
  },
  messageSuccess: {
    marginTop: "20px",
    padding: "15px",
    backgroundColor: "#e8f5e9",
    border: "1px solid #4caf50",
    color: "#388e3c",
    borderRadius: "6px",
    textAlign: "center",
  },
  messageError: {
    marginTop: "20px",
    padding: "15px",
    backgroundColor: "#ffebee",
    border: "1px solid #f44336",
    color: "#d32f2f",
    borderRadius: "6px",
    textAlign: "center",
  },
};

const Register = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
    bloodGroup: "",
    city: "",
    phone: "",
  });

  const [message, setMessage] = useState("");
  const [isError, setIsError] = useState(false);
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage("Registering...");
    setIsError(false);
    setIsSubmitting(true);

    try {
      await registerDonor(formData);
      setMessage("Registration successful! Thank you for your contribution.");
      setIsError(false);

      // Clear form data on success
      setFormData({
        name: "",
        email: "",
        password: "",
        bloodGroup: "",
        city: "",
        phone: "",
      });
    } catch (err) {
      const errorMsg =
        err.message ||
        err.error ||
        "Error registering donor. Please check your information.";
      setMessage(errorMsg);
      setIsError(true);
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>
        ðŸ©¸ Donor Registration{" "}
        <small
          style={{
            fontWeight: 400,
            fontSize: "0.6em",
            display: "block",
            color: "#546e7a",
          }}
        >
          Join the network, save a life.
        </small>
      </h2>
      <form style={styles.form} onSubmit={handleSubmit}>
        <FormInput
          type="text"
          name="name"
          placeholder="Full Name"
          value={formData.name}
          onChange={handleChange}
          required
        />
        <FormInput
          type="email"
          name="email"
          placeholder="Email Address"
          value={formData.email}
          onChange={handleChange}
          required
        />
        <FormInput
          type="password"
          name="password"
          placeholder="Secure Password"
          value={formData.password}
          onChange={handleChange}
          required
        />
        <FormInput
          type="text"
          name="bloodGroup"
          placeholder="Blood Group (e.g., A+, O-)"
          value={formData.bloodGroup}
          onChange={handleChange}
          required
        />
        <FormInput
          type="text"
          name="city"
          placeholder="City/Locality"
          value={formData.city}
          onChange={handleChange}
          required
        />
        <FormInput
          type="tel"
          name="phone"
          placeholder="Phone Number"
          value={formData.phone}
          onChange={handleChange}
          required
        />
        <button type="submit" style={styles.button} disabled={isSubmitting}>
          {isSubmitting ? "Registering..." : "Register & Donate"}
        </button>
      </form>
      {message && (
        <p style={isError ? styles.messageError : styles.messageSuccess}>
          {message}
        </p>
      )}
    </div>
  );
};

export default Register;
